import React, {Component} from 'react';
import { NavLink } from 'react-router-dom';


class clinicalSkills extends Component {
	render() {
		return(
	<div>
		<h2 className = 'f3' > 
		{'Oxygen Therapy'}
		</h2>
	     <NavLink to = "/OxygenTherapy">
		  <button><img src alt= 'icon' src={require('./mask.jpg')}/> 
		  </button>
		 </NavLink>



	<div>
		<h2 className = 'f3' > 
		{'ABG'}
		</h2>
	     <NavLink to = "/OxygenTherapy">
		  <button><img src alt= 'icon' src={require('./ABG.jpg')}/> 
		  </button>
		 </NavLink>

		</div>	
		</div>

		);
	}
}


